import React, { useEffect, useState } from 'react';
import './Process.css';

const steps = [
	{
		step: '01',
		title: 'Discovery & Planning',
		desc: 'We analyze your requirements and create a detailed project plan.',
		icon: (
			<svg xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 24 24" strokeWidth={1.5} stroke="currentColor"><path strokeLinecap="round" strokeLinejoin="round" d="M21 21l-5.197-5.197m0 0A7.5 7.5 0 105.196 5.196a7.5 7.5 0 0010.607 10.607z" /></svg>
		),
	},
	{
		step: '02',
		title: 'Design & Prototyping',
		desc: 'Create wireframes and design mockups for your approval.',
		icon: (
			<svg xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 24 24" strokeWidth={1.5} stroke="currentColor"><path strokeLinecap="round" strokeLinejoin="round" d="M16.862 4.487l1.687-1.688a1.875 1.875 0 112.652 2.652L6.832 19.82a4.5 4.5 0 01-1.897 1.13l-2.685.8.8-2.685a4.5 4.5 0 011.13-1.897L16.863 4.487zm0 0L19.5 7.125" /></svg>
		),
	},
	{
		step: '03',
		title: 'Development',
		desc: 'Build your website using best practices and industry standards.',
		icon: (
			<svg xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 24 24" strokeWidth={1.5} stroke="currentColor"><path strokeLinecap="round" strokeLinejoin="round" d="M6.75 7.5l3 2.25-3 2.25m4.5 0h3m-9 8.25h13.5A2.25 2.25 0 0021 18V6a2.25 2.25 0 00-2.25-2.25H5.25A2.25 2.25 0 003 6v12a2.25 2.25 0 002.25 2.25z" /></svg>
		),
	},
	{
		step: '04',
		title: 'Testing & Launch',
		desc: 'Thorough testing and deployment to ensure everything works perfectly.',
		icon: (
			<svg xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 24 24" strokeWidth={1.5} stroke="currentColor"><path strokeLinecap="round" strokeLinejoin="round" d="M15.59 14.37a6 6 0 01-5.84 7.38v-4.8m5.84-2.58a14.98 14.98 0 006.16-12.12A14.98 14.98 0 009.63 2.18c-2.35 0-4.59.75-6.32 2.06l-.72-.72a14.98 14.98 0 00-5.05 12.12 14.98 14.98 0 005.05 12.12l.72-.72a6 6 0 01-2.06-6.32l-4.8 5.84m14.37-5.84l-5.84 4.8" /></svg>
		),
	},
];

const ProcessStep = ({ item, idx, isVisible }) => (
	<div
		key={item.step}
		className={`process-step ${isVisible ? 'animate-in' : ''}`}
		style={{ animationDelay: `${idx * 0.15}s` }}
		aria-label={`Step ${item.step}: ${item.title}`}
	>
		<div className="step-icon" aria-hidden="true">
			{item.icon}
		</div>
		<div className="step-number">{item.step}</div>
		<div className="step-content">
			<h3>{item.title}</h3>
			<p>{item.desc}</p>
		</div>
	</div>
);

function Process() {
	const [isVisible, setIsVisible] = useState(false);
	const processRef = React.useRef(null);

	useEffect(() => {
		const observer = new IntersectionObserver(
			(entries) => {
				entries.forEach((entry) => {
					if (entry.isIntersecting) {
						setIsVisible(true);
						observer.unobserve(entry.target);
					}
				});
			},
			{ threshold: 0.2 }
		);

		if (processRef.current) {
			observer.observe(processRef.current);
		}

		return () => observer.disconnect();
	}, []);

	return (
		<section className="process-section" ref={processRef} aria-labelledby="process-title">
			<div className="container">
				<div className="section-header">
					<h2 id="process-title" className="section-title">Our Process</h2>
					<p className="section-subtitle">A systematic approach to delivering high-quality web solutions.</p>
				</div>
				<div className="process-timeline">
					{steps.map((item, idx) => (
						<ProcessStep key={item.step} item={item} idx={idx} isVisible={isVisible} />
					))}
				</div>
			</div>
		</section>
	);
}

export default Process;
